using ShineEngine;

/// <summary>
/// 开始匹配消息(generated by shine)
/// </summary>
public class FuncStartMatchResponse:FuncSResponse
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=GameResponseType.FuncStartMatch;
	
	public FuncStartMatchResponse()
	{
		_dataID=GameResponseType.FuncStartMatch;
	}
	
	/// <summary>
	/// 执行
	/// </summary>
	protected override void execute()
	{
		//匹配中
		me.scene.setMatchingFuncID(funcID);
		me.dispatch(GameEventType.StartMatch);
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "FuncStartMatchResponse";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		base.toReadBytesFull(stream);
		
		stream.startReadObj();
		
		stream.endReadObj();
	}
	
}
